    open class func getUsersByUseridItemsLatestWithRequestBuilder(userId: String, limit: Int? = nil, parentId: String? = nil, fields: String? = nil, includeItemTypes: String? = nil, mediaTypes: String? = nil, isFolder: Bool? = nil, isPlayed: Bool? = nil, groupItems: Bool? = nil, enableImages: Bool? = nil, imageTypeLimit: Int? = nil, enableImageTypes: String? = nil, enableUserData: Bool? = nil) -> RequestBuilder<[BaseItemDto]> {
        var path = "/Users/{UserId}/Items/Latest"
        let userIdPreEscape = "\(userId)"
        let userIdPostEscape = userIdPreEscape.addingPercentEncoding(withAllowedCharacters: .urlPathAllowed) ?? ""
        path = path.replacingOccurrences(of: "{UserId}", with: userIdPostEscape, options: .literal, range: nil)
        let URLString = embyclient-rest-swift-betaAPI.basePath + path
        let parameters: [String:Any]? = nil
        var url = URLComponents(string: URLString)
        url?.queryItems = APIHelper.mapValuesToQueryItems([
                        "Limit": limit?.encodeToJSON(), 
                        "ParentId": parentId, 
                        "Fields": fields, 
                        "IncludeItemTypes": includeItemTypes, 
                        "MediaTypes": mediaTypes, 
                        "IsFolder": isFolder, 
                        "IsPlayed": isPlayed, 
                        "GroupItems": groupItems, 
                        "EnableImages": enableImages, 
                        "ImageTypeLimit": imageTypeLimit?.encodeToJSON(), 
                        "EnableImageTypes": enableImageTypes, 
                        "EnableUserData": enableUserData
        ])


        let requestBuilder: RequestBuilder<[BaseItemDto]>.Type = embyclient-rest-swift-betaAPI.requestBuilderFactory.getBuilder()

        return requestBuilder.init(method: "GET", URLString: (url?.string ?? URLString), parameters: parameters, isBody: false)
    }
